import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  labelList:{label:string, color:string}[] = [{label:'SKILLS', color: 'red'},
  {label:'EXPERIENCE', color: 'blue'},
  {label:'DIPLOMA', color: 'green'},
  {label:'DIPLOMA_MAJOR', color: 'purple'},]
  selectedLabel: {label:string, color:string} | null = null;

  documentContent!: string;

  onFileUploaded(content: string) {
    this.documentContent = content;
  }

  selectedLabel(label: {label:string, color:string}) {}
}
